import { SetState } from 'react'
import './App.css';
import Button from './components/Button/Button'
import Input from './components/Input/Input'

function App() {
  const [email, setEmail] = setState()
  return (
    <div className="App">
      <header className="App-header">
        <Input value={email}/>
        <Input />
        <Button />
      </header>
    </div>
  );
}

export default App;
